import { useState } from "react"
import Table from "./bingTable"
import { GetAllEntries } from "./methods"

const TableScreen = () => {
    const [entries, setEntries] = useState([])

    return(
        <>
            <div className="col-sm">
                <button onClick={() => updateEntries("Bing","getAll")} className="btn btn-dark btn-lg w-100 h-100">Bing Table</button>
            </div>
            <Table data={entries} rowsPerPage={100}/>
        </>
    )

    function updateEntries(table, method) {
        var arr = []
        if(method === "getAll"){
            arr = GetAllEntries()
            setEntries(arr)
        }
    }
}

export default TableScreen
